import React, { Component } from 'react';

import { sampleGridConfig } from '../../config/grid';

import Container from './Container';

import * as G from './style';

class Grid extends Component {
  render() {
    return (
      <G.Wrapper id={sampleGridConfig.id}>
        {sampleGridConfig.children &&
          sampleGridConfig.children.map((childConfig, index) => (
            <Container
              key={index}
              id={childConfig.id}
              children={childConfig.children}
            />
          ))}
      </G.Wrapper>
    );
  }
}

export default Grid;
